import React from "react";

export default function Row(props) {
  function handleDelete() {
    props.onDelete(props.id);
  }
  function handleEdit() {
    props.onEdit(props.id);
  }
  return (
    <tr>
      <td>{props.id}</td>
      <td>{props.name}</td>
      <td>{props.age}</td>
      <td>
        <button style={{ backgroundColor: "yellow", color: "black", padding: "5px  12px" }} onClick={handleEdit}>Edit</button>
      </td>
      <td>
        <button style={{ backgroundColor: "red", color: "black", padding: "5px 12px" }} onClick={handleDelete}>Delete</button>
      </td>
    </tr>
  );
}
